import Header from "../components/Header";
import Footer from '../components/Footer';
import { Formik , Form, Field, FieldArray, ErrorMessage } from 'formik';
import * as yup from 'yup';
import axios from 'axios';
import { Await, Link,useNavigate } from 'react-router-dom';


const UpdateProfile = () => {

    
    return (
        <>
        <Header 
        pageLink = '/signup'
        pageName = "Sign Out"
        />
        <section className='signup-page dashboard'>
        <div className='sign-left'>
                <ul className='user-pages'>
                    <li><Link className='custom-btn' to='/updateprofile'>Update Your Profile</Link> </li>
                    <li><Link className='custom-btn' to='updateprofile'>Upload Your Documents</Link> </li>
                    <li><Link className='custom-btn' to='updateprofile'>Inquery</Link> </li>
                    <li><Link className='custom-btn' to='updateprofile'>Sign Out</Link> </li>
                </ul>
            </div>
            <div className='sign-right'>
                <div className='main-form'>
                    <h2>Update Your Profile Details :</h2>
                    
                   
                </div>
                <Footer />
            </div>
        </section>
        </>
      )
    }

export default UpdateProfile;
